import React from "react";
import { useState } from 'react';
import "./Product.scss"
const Product = () => {
  const [selectedImg, setSelectedImg] = useState("img");
  const [quantity, setQuantity] = useState(1);
  const images = [
    "https://www.brookfieldengineering.com/-/media/ametekbrookfield/azic/blogs/mainimage/dog-food-1024x683.jpg?la=en&revision=b926348f-52c0-4aab-ab4f-e113c27ddb14&hash=D2897CBE3C2D3463F561A6878B6DC7EE",
    "https://cats.com/wp-content/uploads/2022/05/Home-WestCoastKitchen-BG-bags2-600x600-compressed.jpg",
  ];
  return (
<div className='Product'>
      <div className='left'>
      <div  className="images">
      <img src={images[0]} alt='' onClick={e=>setSelectedImg(0)}/>
      <img src={images[1]} alt='' onClick={e=>setSelectedImg(1)}/>
      </div>
      <div className='mainImg'>
       <img src={images[selectedImg]} alt=''/>
       </div>
      </div>

      <div className='right'>
          <h1>Title</h1>
          <span>$199</span>
          <p>This is a product for sale</p>
        <div className='quantity'>
         <button onClick={e=>setQuantity(prev => prev-1)}>-</button> {quantity}
         <button onClick={e=>setQuantity(prev => prev+1)}>+</button>
        </div>

      </div>

    </div>
  )
}
 
export default Product
